import re
from scripting import e2vdom
from utils.csrf import create_csrf_token, csrf_token_arg_name


class VDOM_form(VDOM_object):

	def check_unit(self, value):
		return value + "px" if value.isdigit() else value

	def render(self, contents=""):
		display = u"none" if self.visible == "0" else self.displaying
		zind = u"%s" % self.zindex if int(self.zindex) != 0 else u""
		e2vdom.process(self)

		overflow_values = {
			"0": "auto",
			"1": "hidden",
			"2": "scroll",
			"3": "visible"
		}
		overflow = overflow_values.get(self.overflow, "")

		if not self.target or self.meth == "event":
			target = u""
		else:
			ref_obj = application.objects.search(self.target)
			target = u"/%s.vdom" % ref_obj.name if ref_obj else u""

		submitonce = u""

		woid = (self.id).replace('-', '_')
		id = u"o_" + woid
		reportvalidity = self.reportvalidity
		css = u"<style>\n" + self.style % {"id": id} + u"</style>" if self.style else u""

		if self.meth == "post":
			csrftoken = '<input type="hidden" name="%s" value="%s">' % (csrf_token_arg_name, create_csrf_token())
		else:
			csrftoken = ""

		if self.meth == "event":
			submitjs = u"""
      <script type="text/javascript">$(function () {new $.SubmitVDOMFormJs("%(id)s", %(reportvalidity)s);});
      </script>""" % { "id": id, "woid": woid, "reportvalidity": "true" if reportvalidity == "1" else "false"}
		else:
			submitjs = u""

		if not self.enctype or self.meth == "event":
			enctype = u""
		else:
			enctype = u"""enctype="%s" """ % self.enctype

		position = u"{pos}".format(pos=self.positioning) if self.positioning and self.positioning != "static" else u""

		styles = {
			"z-index": zind,
			"display": display,
			"position": position,
			"width": self.check_unit(self.width),
			"height": self.check_unit(self.height),
			"margin": self.margins,
			"padding": self.paddings,
			"top": self.check_unit(self.top),
			"left": self.check_unit(self.left),
			"overflow": overflow
		}
		if self.positioning == "static":
			styles["top"] = styles["left"] = ""

		styles_str = " ".join(["{}: {};".format(key, value) for key, value in styles.items() if value])

		if VDOM_CONFIG_1["DEBUG"] == "1":
			debug_info = u"objtype='form' objname='%s' ver='%s'" % (self.name, self.type.version)
		else:
			debug_info = u""

		result = u"""\
		        {css}
			    <form {debug_info} id="{id}" style="{style}" 
					name="{name}" method="{method}" action="{target}" 
					{enctype} {submitonce} class="vdom_form {classname}">
					{contents}
					{csrftoken}
				</form> {submitjs} 
			""".format(
					debug_info = debug_info, id = id, display = display, style = styles_str, name = self.name, 
					method = self.meth, target = target, enctype = enctype, submitonce = submitonce, css = css,
					contents = contents, csrftoken=csrftoken, submitjs = submitjs, classname = self.classname )

		return VDOM_object.render(self, contents=result)

	def regex(self, obj):
		match = re.search(r'\d+', obj)
		return int(match.group()) if match else ""

	def wysiwyg(self, contents=""):
		width, height, top, left = map(self.regex, (self.width, self.height, self.top, self.left))

		width = int(width) if width else 400
		height = int(height) if height else 200

		if len(contents) == 0:
			from scripting.legacy.wysiwyg import get_empty_wysiwyg_value			
			image_id = "54e7f8ab-64f1-b113-029e-1703a76c6fa4"
			self.width = width
			self.height = height
			self.top = top
			self.left = left
			result = get_empty_wysiwyg_value(self, image_id)
#			result = \
#        			u"""<container name="{name}" id="{id}" visible="{vis}" zindex="{zind}" hierarchy="{hierarchy}" top="{top}"
#        				 left="{left}" width="{width}" height="{height}" backgroundcolor="#f0f0f0" bordercolor="#000000">
#        					<svg>
#                				<image href="#Res({img_id})" x="{x}" y="{y}"/>
#                			</svg>
#                		</container>
#                	""".format(
#            				id = self.id, vis = self.visible, zind = self.zindex,
#            				hierarchy = self.hierarchy, top = top, left = left,
#            				width = width, height = height,
#            				img_id = image_id, name = self.name,
#            				x = (int(width) - 50) / 2, y = (int(height) - 50) / 2)

			return VDOM_object.wysiwyg(self, contents=result)

		# get overflow value
		overflow_dict = {"0":"auto", "1":"hidden", "2":"scroll", "3":"visible"}
		overflow_num = self.overflow if self.overflow else "0"
		overflow = overflow_dict[overflow_num]

		result = u"""<container name="{name}" id="{id}" visible="{vis}" zindex="{zind}" hierarchy="{hierarchy}" order="{order}" 
							top="{top}" left="{left}" width="{width}" height="{height}" overflow="{overflow}">
						<svg>
							<rect x="0" y="0" width="{width}" height="{height}" fill="#EEEEEE" fill-opacity=".4" />
						</svg>{contents}
					</container>
				""".format(id = self.id, vis = self.visible, zind = self.zindex, name = self.name,
				hierarchy = self.hierarchy, order = self.order, 
				top = top, left = left, width = width, height = height, 
				contents = contents,
				overflow = overflow)

		return VDOM_object.wysiwyg(self, contents=result)

def on_update(object, attributes):
	o = object
	modifications = {}

	for attr in ["left", "top", "width", "height"]:
		if attr in attributes:
			new_value = attributes.get(attr)
			unit = re.findall("[a-z%]+", o.attributes.get(attr, ""))
			unit = unit[0] if unit and unit[0]!="auto" else "px"
			if new_value is not None and new_value.isdigit():
				new_value = new_value + unit
			modifications[attr] = new_value
	attributes.update(modifications)

	empty = ""

	users = """\
#%(id)s {

}
"""

	skin_mapping = {
		"0": users,
		"1": empty
	}
	if "skin" in attributes:
		skin = attributes["skin"]
		if skin in skin_mapping:
			attributes.update(style=skin_mapping[skin])
		else:
			attributes.update(skin="0")

	if "style" in attributes and attributes.get("style") not in skin_mapping.values():
		attributes.update(skin="0")

	return ""
